import React from 'react';
import './Techs.css';

export default function Techs() {
  return (
    <div className='techs'>
      <p className="techs__title">Технологии</p>
      <div className="techs__line"></div>
      <p className="techs__about">7 технологий</p>
      <p className="techs__subtitle"></p>
    </div>
  )
}
